import { Component, Input, OnInit } from '@angular/core';
import { CompetitionService } from '../../services/competition.service';
@Component({
	selector: 'app-team-logo',
	templateUrl: './team-logo.html',
	providers: [CompetitionService]
})

export class TeamLogoComponent implements OnInit {
	@Input() teamId: number;
	binaryImage: string;
	loading: boolean;
	constructor(private competitionService: CompetitionService) { }

	ngOnInit() {
		this.binaryImage = 'data:image/png;base64,';

		this.competitionService.retrieveTeamLogo(this.teamId).subscribe(result => {
				this.loading = true;
				this.binaryImage = result;
				setTimeout(x => {this.loading = false}, 100);
			});
	}
}
